INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 0, "あたしだって\nやるときはやるよ！", 0.0, 24001, 24, 10040, 1, 1, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 1, "ふぅ…\nこれであたしの仕事は\n終わりだね", 0.0, 24002, 24, 10040, 1, 1, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 2, "終わった終わった\n一人でもなんとか\nなるもんだね", 0.0, 24003, 24, 10040, 1, 1, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 3, "やったね！\nこれでようやく\nサボれるよ…", 0.0, 24004, 24, 10040, 2, 2, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 4, "チーズが欲しいなら\nきちんと働いて\n買いに来なよ", 0.0, 24005, 24, 10040, 1, 1, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 5, "あたしを敵に回した\n恐ろしさ\n思い知ったか！", 0.0, 24006, 24, 10040, 2, 2, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 6, "あたしも意外と\nやるもんでしょ？", 0.0, 24007, 24, 10040, 2, 2, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 7, "疲れた…\nねずみの逃げ足\n速すぎるよ…", 0.0, 24008, 24, 10040, 4, 4, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 8, "このままじゃ\nまっひ～に\n叱られちゃうよ", 0.0, 24009, 24, 10040, 4, 4, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 9, "まじめに\nやったんだけどな…\n悔しいな～", 0.0, 24010, 24, 10040, 4, 4, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 10, "やられた…\nねずみって意外と\nてごわいね", 0.0, 24011, 24, 10040, 4, 4, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 0.0, 102601, 11, "おのれ～\nあたしのチーズを\n盗みやがって～！", 0.0, 24012, 24, 10040, 4, 4, 0.0, "2020/04/30 12:00:00");
INSERT INTO `v1_131861949482e4598a622960735044cc0eb41bd6438704a9a7f01e533118f14d` VALUES ("2030/12/17 14:59:59", "リン", 1.81, 102601, 12, "疲れた…\nけど、次こそは\n守り抜くよ…", 0.0, 24013, 24, 10040, 1, 4, 0.0, "2020/04/30 12:00:00");
